The symbol of the new age and creativity. #FollowMeTo Museum of the Future in Dubai. Its external panels are marked with the Arabic calligraphy and its shape can be defined by some as torus, others prefer to liken it to an eye.  It is one of the most complex construction projects ever attempted. Being a Civil Engineer - I can confirm that :)). “The future belongs to those who can imagine it, design it, and execute it…The future does not wait…The future can be designed and built today.”

@mydubai @museumofthefuture #mydubai

