Do you remember when we went to Abu Dhabi?
Still impressed with this trip and the shooting there was full of inspiration and beauty. Who has been there, guys? Good news is that now the borders are open to all vaccinated worldwide travelers, so it’s getting much easier to get there and meet both the modern culture & history.
